insert into excel_to_postgres(interview_id,id,col0,col1,col2,col3,col4,col5,col6,col7,col8,col9,col10,col11,col12,col13,col14,col15,col16,col17,col18,col19,col20,col21,col22,col23,col24,col25,col26) values (0,1054,$$4130$$,$$Quý 2$$,$$quynd10$$,$$kimtg$$,$$Chủ chốt$$,$$null$$,$$NaN:NaN$$,$$NaN:NaN$$,$$null$$,$$> 1 năm$$,$$null$$,$$> 6 tháng$$,$$null$$,$$null$$,$$null$$,$$null$$,$$null$$,$$Điều gì trong công việc thôi thúc bạn phải rời khỏi giường vào mỗi sáng? Điều gì tạo nên một ngày làm việc tuyệt với?$$,$$Ra ngoài xã hội.
insert into excel_to_postgres(interview_id,id,col0,col1,col2,col3,col4,col5,col6,col7,col8,col9,col10,col11,col12,col13,col14,col15,col16,col17,col18,col19,col20,col21,col22,col23,col24,col25,col26) values (0,1055,$$4188$$,$$Quý 2$$,$$quyvd$$,$$ngochtt3$$,$$Chủ chốt$$,$$null$$,$$NaN:NaN$$,$$NaN:NaN$$,$$null$$,$$> 1 năm$$,$$null$$,$$> 1 năm$$,$$null$$,$$null$$,$$null$$,$$null$$,$$null$$,$$Bạn nghĩ sao nếu người lãnh đạo mới của bộ phận là người trẻ và ít kinh nghiệm chuyên môn hơn bạn?$$,$$Điều đó là bình thường, kinh nghiệm chuyên không phản ánh một người lãnh đạo giỏi. Một người lãnh đạo cần tố chất định hướng, dẫn dắt, không nhất thiết phải là người có kinh nghiệm chuyên môn giỏi.$$,$$Đào tạo$$,$$Đặc thù của cty là triển khai dự án, đào tạo nhân viên chủ yếu là on-job, chưa có hệ thống hoàn chỉnh về đào tạo tác phong làm việc, kỹ năng cứng và mềm cho tất cả vị trí. Ví dụ: viết một cái email như nào cho đúng, cách giao tiếp và truyền đạt thông tin ra sao, một tester thì cần làm những gì, Dev cần sử dụng thành tạo những tool gì... Nhân viên được tuyển phân bổ sang dự án luôn, thỉnh thoảng mới có khóa đào tạo kỹ năng bổ sung. Cần tăng cường sử dụng đào tạo với giảng viên nội bộ, phù hợp với đặc thù công việc của công ty.$$,$$Chưa đáp ứng$$,$$null$$,$$null$$,$$NaN/NaN/NaN$$,$$Đã chuyển thông tin lên bộ phận nhân sự$$,$$Quy định nội bộ, chưa thể thay đổi ngay$$);
